import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Topbar from '../components/Topbar';
import { Box, Typography, Paper, Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, TextField, Modal } from '@mui/material';
import { useNavigate } from 'react-router-dom';

function Clientes() {
  const [clientes, setClientes] = useState([]);
  const [openModal, setOpenModal] = useState(false);
  const [novoCliente, setNovoCliente] = useState({
    nome: '',
    cpf_cnpj: '',
    telefone: '',
    email: '',
    status: 'Ativo',
  });
  const navigate = useNavigate();
  const handleLogout = () => {
    localStorage.removeItem('neofi_auth');
    navigate('/');
  };

  useEffect(() => {
    axios.get('http://localhost:8000/clientes')
      .then(response => setClientes(response.data))
      .catch(error => console.error('Erro ao buscar clientes:', error));
  }, []);

  const handleOpenModal = () => setOpenModal(true);
  const handleCloseModal = () => setOpenModal(false);
  const handleChange = (e) => {
    setNovoCliente({ ...novoCliente, [e.target.name]: e.target.value });
  };

  return (
    <Box>
      <Topbar />
      <Box sx={{ p: 4 }}>
        <Box sx={{ display: 'flex', justifyContent: 'flex-end', mb: 2 }}>
          <Button variant="contained" color="error" onClick={handleLogout}>Sair</Button>
        </Box>
        <Typography variant="h4" color="primary" gutterBottom>Lista de Clientes</Typography>
        <Box sx={{ mb: 2, textAlign: 'right' }}>
          <TextField label="Buscar por CPF/CNPJ" size="small" sx={{ width: 220 }} />
        </Box>
        <TableContainer component={Paper} sx={{ mb: 3 }}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Nome</TableCell>
                <TableCell>CPF/CNPJ</TableCell>
                <TableCell>Telefone</TableCell>
                <TableCell>Email</TableCell>
                <TableCell>Status</TableCell>
                <TableCell>Data de Entrada</TableCell>
                <TableCell>Última Mov.</TableCell>
                <TableCell>Ver Operação</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {clientes.map((cliente) => (
                <TableRow key={cliente.id}>
                  <TableCell>{cliente.nome}</TableCell>
                  <TableCell>{cliente.cpf_cnpj}</TableCell>
                  <TableCell>{cliente.telefone}</TableCell>
                  <TableCell>{cliente.email}</TableCell>
                  <TableCell>{cliente.status}</TableCell>
                  <TableCell>{cliente.data_entrada}</TableCell>
                  <TableCell>{cliente.ultima_movimentacao}</TableCell>
                  <TableCell>
                    <Button variant="outlined" size="small">Ver Operação</Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
        <Button variant="contained" color="primary" onClick={handleOpenModal}>Adicionar Novo Cliente</Button>
        <Modal open={openModal} onClose={handleCloseModal}>
          <Box sx={{ position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)', width: 400, bgcolor: 'background.paper', boxShadow: 24, p: 4, borderRadius: 2 }}>
            <Typography variant="h6" gutterBottom>Adicionar Novo Cliente</Typography>
            <TextField fullWidth margin="normal" label="Nome" name="nome" value={novoCliente.nome} onChange={handleChange} />
            <TextField fullWidth margin="normal" label="CPF/CNPJ" name="cpf_cnpj" value={novoCliente.cpf_cnpj} onChange={handleChange} />
            <TextField fullWidth margin="normal" label="Telefone" name="telefone" value={novoCliente.telefone} onChange={handleChange} />
            <TextField fullWidth margin="normal" label="Email" name="email" value={novoCliente.email} onChange={handleChange} />
            <TextField fullWidth margin="normal" label="Status" name="status" value={novoCliente.status} onChange={handleChange} />
            <Box sx={{ display: 'flex', justifyContent: 'flex-end', mt: 2 }}>
              <Button onClick={handleCloseModal} sx={{ mr: 1 }}>Cancelar</Button>
              <Button variant="contained" color="primary">Salvar</Button>
            </Box>
          </Box>
        </Modal>
      </Box>
    </Box>
  );
}

export default Clientes;
